import React, { useState, useEffect, useCallback } from 'react';
import axios from 'axios';
import './App.css';

function App() {
  const [facts, setFacts] = useState([]);
  const [filters, setFilters] = useState({ ipr_type: 'All', domain: 'All', sort: 'Newest' });

  // ✅ STEP 1: Define the function FIRST
  // We use useCallback to fix the "missing dependency" warning
  const fetchFacts = useCallback(async () => {
    try {
      const params = new URLSearchParams(filters).toString();
      const response = await axios.get(`http://localhost:5000/api/facts?${params}`);
      setFacts(response.data);
    } catch (error) {
      console.error("Error fetching data:", error);
    }
  }, [filters]); 

  // ✅ STEP 2: Call the function inside useEffect AFTER it is defined
  useEffect(() => {
    fetchFacts();
  }, [fetchFacts]); 

  const handleFilterChange = (e) => {
    setFilters({ ...filters, [e.target.name]: e.target.value });
  };

  // Function to add sample data to your empty database
  const seedData = async () => {
    try {
      await axios.post('http://localhost:5000/api/facts/seed');
      alert('Sample data added successfully!');
      fetchFacts(); // Refresh the list immediately
    } catch (error) {
      console.error(error);
      alert('Error adding data. Make sure backend is running.');
    }
  };

  return (
    <div className="container">
      <header>
        <h1>IPQuest Fact Explorer</h1>
        <p>Discover Intellectual Property Trends</p>
      </header>

      <div className="controls">
        <select name="ipr_type" onChange={handleFilterChange} value={filters.ipr_type}>
          <option value="All">All Types</option>
          <option value="Patent">Patent</option>
          <option value="Copyright">Copyright</option>
          <option value="Trademark">Trademark</option>
          <option value="Trade Secret">Trade Secret</option>
        </select>
        
        <select name="domain" onChange={handleFilterChange} value={filters.domain}>
          <option value="All">All Domains</option>
          <option value="Technology">Technology</option>
          <option value="Entertainment">Entertainment</option>
          <option value="Fashion">Fashion</option>
          <option value="Food & Beverage">Food & Beverage</option>
          <option value="Healthcare">Healthcare</option>
        </select>

        <select name="sort" onChange={handleFilterChange} value={filters.sort}>
          <option value="Newest">Newest First</option>
          <option value="Oldest">Oldest First</option>
        </select>

        <button className="seed-btn" onClick={seedData}>
           Add Sample Data
        </button>
      </div>

      <div className="grid">
        {facts.length > 0 ? (
          facts.map((fact) => (
            <div key={fact._id} className={`card ${fact.ipr_type.replace(" ", "")}`}>
              <span className="badge">{fact.ipr_type}</span>
              <h3>{fact.title}</h3>
              <p>{fact.description}</p>
              <div className="footer">
                <span>{fact.domain}</span>
                <span>{fact.year}</span>
              </div>
            </div>
          ))
        ) : (
          <p style={{ textAlign: 'center', width: '100%' }}>No facts found. Try adding sample data!</p>
        )}
      </div>
    </div>
  );
}

export default App;
